(11, 'demande d\'information', 'je veux avoir des informations sur la voiture X ', '2023-11-19 16:12:34', 1, 1),
(12, 'Réclamation suite à une expérience de location de voiture insatisfaisante', 'Je tiens à exprimer ma profonde déception concernant la location de voiture effectuée auprès de votre agence. Le véhicule attribué présentait des défauts techniques non signalés à la prise en charge, tels que des problèmes de climatisation et des bruits moteur. De plus, le processus de restitution a été laborieux en raison du manque de coopération du personnel sur place, entraînant un retard et des désagréments. Cette expérience a non seulement compromis le confort de mon trajet, mais a également engendré des coûts supplémentaires. Dans l\'optique d\'une résolution, je sollicite un remboursement partiel des frais de location et des explications sur les mesures préventives envisagées pour éviter de tels incidents à l\'avenir. J\'espère une prise en compte rapide de ma réclamation.', '2023-11-20 18:21:16', 1, 1),
(13, 'reclamation', '\r\nJe tiens à exprimer ma satisfaction extrême suite à la récente expérience de location de voiture avec votre agence. Le véhicule fourni était impeccable et bien entretenu, contribuant ainsi au confort de mon voyage. Le professionnalisme et la convivialité du personnel ont été remarquables, rendant le processus de prise en charge et de restitution du véhicule efficace et agréable. La transparence lors de la réservation a également été appréciée. Cette expérience positive a dépassé mes attentes, et je tiens à vous féliciter pour la qualité exceptionnelle de vos services. Je n\'hésiterai pas à recommander votre agence à d\'autres et à faire appel à vous pour mes futures locations de voiture.', '2023-11-20 18:22:19', 1, 1),
(14, 'demande d\'information', 'Je veux savoir des informations sur ......', '2023-11-23 18:54:08', 1, 1),
(15, 'demande d\'information', 'FSTDFZYDGZ', '2023-11-26 17:57:52', 1, 1);

